import React from "react";

const ReadLater = ({ article }) => {
  return (
    <div>
      <button>&#10005;</button>
      <a href={article.url} target="_blank" rel="noopener noreferrer">
        {article.title}
      </a>
    </div>
  );
};

export default ReadLater;
